import React from "react";

const Boxes = () => {
  return (
    <div className="education">
      <div className="education-1">FRONTEND DEVELOPER</div>
      <div className="education-2">ENTREPENEUR</div>
      <div className="education-3">SOFTS SKILLS</div>
      <div className="education-4">KNOW ME BETTER</div>
    </div>
  );
};

export default Boxes;
